var title_f19_58_20395="Symptom criteria dx sinusitis";
var content_f19_58_20395=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F83163&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F83163&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Conventional criteria for the diagnosis of sinusitis based on the presence of at least 2 major or 1 major and &ge;2 minor symptoms",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Major symptoms",
"       </td>",
"       <td class=\"subtitle1\">",
"        Minor symptoms",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Purulent anterior nasal discharge",
"       </td>",
"       <td>",
"        Headache",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Purulent or discolored posterior nasal discharge",
"       </td>",
"       <td>",
"        Ear pain, pressure, or fullness",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Nasal congestion or obstruction",
"       </td>",
"       <td>",
"        Halitosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Facial congestion or fullness",
"       </td>",
"       <td>",
"        Dental pain",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hyposmia or anosmia",
"       </td>",
"       <td>",
"        Fever (for subacute or chronic sinusitis)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fever (for acute sinusitis only)",
"       </td>",
"       <td>",
"        Fatigue",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Criteria originally published in: Meltzer EO, Hamilos DL, Hadley JA, et al. Rhinosinusitis: establishing definitions for clinical research and patient care. J Allergy Clin Immunol 2004; 114:155. Modified version reproduced from: Chow AW, Benninger MS, Brook I, et al. IDSA Clinical Practice Guideline for Acute Bacterial Rhinosinusitis in Children and Adults. Clin Infect Dis 2012; 54:e72, by permission of the Infectious Diseases Society of America. Copyright &copy; 2012 Oxford University Press.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
