var title_f19_58_20396="Etiology balanoposthitis";
var content_f19_58_20396=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F67799&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F67799&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Etiology of balanoposthitis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Infectious",
"      </td>",
"      <td class=\"subtitle1_single\">",
"       Irritant",
"      </td>",
"      <td class=\"subtitle1_single\">",
"       Allergic/immunologic",
"      </td>",
"      <td class=\"subtitle1_single\">",
"       Traumatic",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_single\">",
"       Fungal",
"      </td>",
"      <td rowspan=\"18\">",
"       <p>",
"        Poor hygiene (nonspecific balanoposthitis)",
"       </p>",
"       <p>",
"        Soap or other contact irritant",
"       </p>",
"      </td>",
"      <td rowspan=\"18\">",
"       <p>",
"        Fixed drug eruption",
"       </p>",
"       <p>",
"        Stevens-Johnson syndrome",
"       </p>",
"      </td>",
"      <td rowspan=\"18\">",
"       <p>",
"        Excessive forceful foreskin retraction in young children",
"       </p>",
"       <p>",
"        Friction or entrapment against clothing",
"       </p>",
"       <p>",
"        Hair tourniquet (infant)",
"       </p>",
"       <p>",
"        Masturbation",
"       </p>",
"       <p>",
"        Sexual intercourse",
"       </p>",
"       <p>",
"        Zip-fastener injury",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Candida albicans*",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_single\">",
"       Bacterial",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Escheria coli",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Group B Streptococcus",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Bacteroides species",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Group A Streptococcus*",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Staphylococcus aureus",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Gardnerella vaginalis*",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Neiserris gonorrhea&bull;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Chlamydia trachomatis&bull;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Treponema pallidum&bull;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_single\">",
"       Viral",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Human papillomavirus*",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       <p>",
"        Herpes simplex, type 1*",
"       </p>",
"       <p>",
"        Herpes simplex, type 2&bull;",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_single\">",
"       Protozoan",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Trichomonas vaginalis&bull;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Entameba histolytica*",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Sexual transmission described.",
"     <br>",
"      &bull; Sexual transmission most likely.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
