" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Vaccinations recommended for both autologous and allogeneic HCT recipients",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Vaccine",
"       </td>",
"       <td class=\"subtitle1\">",
"        Recommended for use after HCT",
"       </td>",
"       <td class=\"subtitle1\">",
"        Time post-HCT to initiate vaccine",
"       </td>",
"       <td class=\"subtitle1\">",
"        Number of doses*",
"       </td>",
"       <td class=\"subtitle1\">",
"        Improved by donor vaccination (practicable only in related-donor setting)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pneumococcal conjugate (PCV)",
"       </td>",
"       <td>",
"        Yes (B)",
"       </td>",
"       <td>",
"        3-6 months",
"       </td>",
"       <td>",
"        3-4&bull;",
"       </td>",
"       <td>",
"        Yes; may be considered when the recipient is at high risk for chronic GVHD",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"3\">",
"        Tetanus, diphtheria, acellular pertussis&Delta;",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td rowspan=\"3\">",
"        6-12 months",
"       </td>",
"       <td rowspan=\"3\">",
"        3&loz;",
"       </td>",
"       <td>",
"        Tetanus: likely",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Tetanus-diphtheria: (B)",
"       </td>",
"       <td>",
"        Diphtheria: likely",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pertussis (C)",
"       </td>",
"       <td>",
"        Pertussis: unknown",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Haemophilus influenzae conjugate",
"       </td>",
"       <td>",
"        Yes (B)",
"       </td>",
"       <td>",
"        6-12 months",
"       </td>",
"       <td>",
"        3",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Meningococcal conjugate",
"       </td>",
"       <td>",
"        Follow country recommendations for general population (B)",
"       </td>",
"       <td>",
"        6-12 months",
"       </td>",
"       <td>",
"        1",
"       </td>",
"       <td>",
"        Unknown",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Inactivated polio",
"       </td>",
"       <td>",
"        Yes (B)",
"       </td>",
"       <td>",
"        6-12 months",
"       </td>",
"       <td>",
"        3",
"       </td>",
"       <td>",
"        Unknown",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Recombinant hepatitis B",
"       </td>",
"       <td>",
"        Follow country recommendations for general population (B)",
"       </td>",
"       <td>",
"        6-12 months",
"       </td>",
"       <td>",
"        3",
"       </td>",
"       <td>",
"        Likely&sect;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Inactivated influenza",
"       </td>",
"       <td>",
"        Yearly (A)",
"       </td>",
"       <td>",
"        4-6 months",
"       </td>",
"       <td>",
"        1-2&yen;",
"       </td>",
"       <td>",
"        Unknown",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"5\">",
"        Measles-Mumps-Rubella&dagger; (live)",
"       </td>",
"       <td>",
"        Measles: all children and seronegative adults",
"       </td>",
"       <td rowspan=\"5\">",
"        24 months",
"       </td>",
"       <td rowspan=\"5\">",
"        1-2&Dagger;",
"       </td>",
"       <td rowspan=\"5\">",
"        Unknown",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Measles: B",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Mumps: C",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Rubella: B",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        (MMR is NOT recommended in patients who are &lt;24 months past transplant, have active GVHD, or are receiving immunosuppression.)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     A: should always be offered; B: should generally be offered; C: optional; HCT: hematopoietic cell transplant; GVHD, graft-versus-host disease.",
"     <br>",
"      * A uniform specific interval between doses cannot be recommended as various intervals have been used in studies. As a general guideline, a minimum of&nbsp;one month between doses may be reasonable.",
"      <br>",
"       &bull; Following the primary series of&nbsp;three PCV doses, a dose of the 23-valent polysaccharide pneumococcal vaccine (PPSV23) to broaden the immune response might be given (B). For patients with chronic GVHD who are likely to respond poorly to PPSV23, a fourth dose of the PCV should be considered instead of PPSV23 (C).",
"       <br>",
"        &Delta; DTaP is preferred, however, if only Tdap is available (eg, because DTaP is not licensed for adults), administer Tdap. Acellular pertussis vaccine is preferred, but the whole-cell pertussis vaccine should be used if it is the only pertussis vaccine available. (See text for more information.)",
"        <br>",
"         &loz; See text for consideration of an additional dose(s) of Tdap for older children and adults.",
"         <br>",
"          &sect; Significant improvement of recipient response to hepatitis B vaccine posttransplant can be expected only if the donor receives more than 1 hepatitis vaccine dose prior to donation.",
"          <br>",
"           &yen; For children &lt;9 years of age,&nbsp;two doses are recommended yearly between transplant and&nbsp;nine years of age.",
"           <br>",
"            &Dagger; Measles, mumps, and rubella vaccines are usually given together as a combination vaccine. In females with pregnancy potential, vaccination with rubella vaccine either as a single or a combination vaccine is indicated.",
"            <br>",
"             &dagger; In children,&nbsp;two doses are favored.",
"            </br>",
"           </br>",
"          </br>",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
